import React, {Component} from 'react';

class Content extends Component{
    constructor(props){
        super(props);
        this.contentTypes = ['Insurances', 'Profile'];
    }

    render(){
        return <div>
            {this.renderTitle()}
        </div>;
    }

    renderTitle = () => {
        return <div className = 'content-title'>
            <h1>{this.contentTypes[this.props.index]}</h1>
        </div>
    }
}

export default Content;
